import React from 'react';
import foto from '../images/Frame 19.png';


function Portfolio() {
    return(
        <div id='features'>
         <div className='features-model'>
             <img src={foto} alt='osmanhakan'/>
         </div>
        </div>
    )
}

export default Portfolio;
